import classes from './CarInfo.module.css';

const CarInfo = (props) => {
  const infoForCar = props.carsInfo.map((cars) => {
    return cars.map((car) => {
      if (car.id === props.loadCarInfo) {
        return (
          <ul key={car.id}>
            <li>Brand: {car.brand}</li>
            <li>Series: {car.series}</li>
          </ul>
        );
      }
    });
  });

  return <div className={classes['car-info']}>{infoForCar}</div>;
};

export default CarInfo;
